import Head from "next/head";
import Header from "../components/Header";
import Card from "../components/Card";
import { ChakraProvider } from "@chakra-ui/react";
import Layout from "../components/Layout";

function App() {
	return (
		<ChakraProvider>
			<Layout>
				<Head>
					<title>Next Practice</title>
				</Head>

				<Header />
				<Card />
			</Layout>
		</ChakraProvider>
	);
}
export default App;
